package ginx
import (
	"context"
	"fmt"
	"github.com/gin-gonic/gin"
)
var (
	GinContextKey = "_GinCtxKey"
)

func GinContextToHttpContext(c *gin.Context) {
	ctx := context.WithValue(c.Request.Context(), GinContextKey, c)
	c.Request = c.Request.WithContext(ctx)
	c.Next()
}

func GetGinContext(ctx context.Context) (*gin.Context, error) {
	ginCtx := ctx.Value(GinContextKey)
	if ginCtx == nil {
		err := fmt.Errorf("could not retrieve gin.Context by %s", GinContextKey)
		return nil, err
	}
	gc, ok := ginCtx.(*gin.Context)
	if !ok {
		err := fmt.Errorf("gin.Context has wrong type: %T", ginCtx)
		return nil, err
	}
	return gc, nil
}
func MustGetGinContext(ctx context.Context) *gin.Context {
	gc, err := GetGinContext(ctx)
	if err != nil {
		panic(err)
	}
	return gc
},go

template <typename ...T, typename F, std::size_t ...i>
auto transform_impl(std::tuple<T...> const& tuple, F const& f,
                    std::index_sequence<i...>)
{
  return std::make_tuple(f(std::get<i>(tuple))...);
}
template <typename ...T, typename F>
auto transform(std::tuple<T...> const& tuple, F const& f) {
  return transform_impl(tuple, f,
            std::make_index_sequence<sizeof...(T)>{});
}

int main() {
  std::tuple<int, char, float> ts{1, '2', 3.3f};
  auto us = transform(ts, [](auto x) {
    std::ostringstream ss;
    ss << x;
    return ss.str();
  });
  assert(us == std::make_tuple("1", "2", "3.3"));
},cpp

