class Solution {
public:
    ListNode* reverseList(ListNode* head) {

        ListNode* root = head;
        while(root && head->next){
            ListNode *p = head->next;
            head->next = p->next;
            p->next = root;
            root = p;
        }
        return root;
    }
};,cpp

